import React, { useEffect } from 'react';
import axios from 'axios';

function Session() {
  useEffect(() => {
    async function fetchData() {
      try {
        const response = await axios.get('/sessions');
        console.log(response.data);
      } catch (error) {
        console.error(error);
      }
    }

    fetchData();
  }, []);

  return <div>Session Data:</div>;
}

export default Session;
